const MovieList = () =>{ 


    const [movies, setmovies] = useState([ 
        { 
            name: 'Harry Potter', 
            price: '$20', 
            id: 22121
        },
        { 
            name: 'Superman', 
            price: '$25', 
            id: 22122
        }, 
        { 
            name: 'Inception', 
            price: '$30', 
            id: 22123
        }


    ]);

    return(
        <div>
        {
            movies.map(moive => {
            <li>{moive.name}</li>
        })}
        </div>

    );


};

export default MovieList;
